// import './App.css'
import React from 'react'
import LoginPage from './components/LoginPage';
// import RegisterAddress from './components/RegisterPageAddress';
import MainStatusPage from './components/MainStatusPage';
import RegisterUsername from './components/RegisterUsername';
import {Route, Router, Switch} from "react-router-dom"



function App() {
  return (
      // <Switch>
      //   <Route path="/" component={LoginPage} />
      //   <Route path="/register" component={RegisterUsername} />
      //   <Route path="/main" component={MainStatusPage} />
      //   {/* <Route exact path="/register2" component={RegisterAddress}/> */}
      // </Switch>
    <div className = "App">
      <Router>
        <Route path="/" component={LoginPage} />
        <Route path="/register" component={RegisterUsername} />
        <Route path="/main" component={MainStatusPage} />
        {/* <Route exact path="/register2" component={RegisterAddress}/> */}
      </Router>
    </div>
  );
}

export default App;
